import React from "react";
import Header from "./Header";

class Work extends React.Component {
  render() {
    return (
      <div>
        <Header />
        <div className="work">
          <h1>Work</h1>
          <p>my work</p>
        </div>
      </div>
    );
  }
}

export default Work;
